import { _Finder } from "../../../stl-cmp";
import search from '../../img/search.svg';

const Finder = () => {
    return (
        <_Finder>
				<label>
					<p>Busca un Can</p>
					<div>
						<input type="text" />
						<button>
							<object data={search} type="image/svg+xml" />
						</button>
					</div>
				</label>
        </_Finder>
    )
}

export default Finder
